import React, {useState, useEffect} from 'react';


const App = () => {
    const [count, setcount] = useState(0);
    useEffect(()=>{
        document.title = `you clicked me ${count} times`;
    },[count]);
    return (
        <>
            <title></title>
            <button onClick={()=>{
                setcount(count+1);
            }}>{count}</button>
        </>
    )
};

export default App;
